import React from "react";

function ShowList({ groceries, deleteItem }) {
  return (
    <div className="ShowList">
      <h1>This is Showing list</h1>
      <ul>
        {groceries.map((grocy, index) => {
          return (
            <li key={index}>
              {grocy}
              <button onClick={deleteItem}>X</button>
              <button>edit</button>
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default ShowList;
